ress, and reproductive health has allowed Bellabeat to empower women with knowledge about their own health and habits.\n","\n"]},{"cell_type":"markdown","id":"83dbc454","metadata":{"papermill":{"duration":0.008624,"end_time":"2022-11-20T02:24:38.674994","exception":false,"start_time":"2022-11-20T02:24:38.66637","status":"completed"},"tags":[]},"source":["Sren asks me to analyze smart device usage data in order to gain insight into how consumers use non-Bellabeat smart devices.Identify potential opportunities for growth and recommendations for the Bellabeat marketing strategy improvement based on trends in smart device usage.# 1.2 Business task\n","Sren asks me to analyze smart device usage data in order to gain insight into how consumers use non-Bellabeat smart devices.Identify potential opportunities for growth and recommendations for the Bellabeat marketing strategy improvement based on trends in smart device usage.\n","       \n","   **Questions For Analysis:**\n","   1. What are some trends in smart device usage?\n","   2. How could these trends apply to Bellabeat customers?\n","   3. How could these trends help influence Bellabeat marketing strategy?"]},{"cell_type":"markdown","id":"dce556dd","metadata":{"papermill":{"duration":0.008055,"end_time":"2022-11-20T02:24:38.69109","exception":false,"start_time":"2022-11-20T02:24:38.683035","status":"completed"},"tags":[]},"source":["# 1.3 Stakeholders for the project :\n","\n","   Urka Sren: Cofounder and Chief Creative Officer\n","   Sando Mur: Cofounder and Mathematician"]},{"cell_type":"markdown","id":"9b4ae2b2","metadata":{"papermill":{"duration":0.008144,"end_time":"2022-11-20T02:24:38.707361","exception":false,"start_time":"2022-11-20T02:24:38.699217","status":"completed"},"tags":[]},"source":["# 2. Prepare Phase:"]},{"cell_type":"markdown","id":"0b29cb05","metadata":{"papermill":{"duration":0.008181,"end_time":"2022-11-20T02:24:38.723607","exception":false,"start_time":"2022-11-20T02:24:38.715426","status":"completed"},"tags":[]},"source":["#  2.1 meta data\n","      \n","*    FitBit Fitness Tracker Data (CC0: Public Domain, dataset made available through Mbius)\n","*    These datasets were generated by respondents to a distributed survey via Amazon Mechanical Turk            between 03.12.2016-05.12.2016. \n","*    Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-        level output for physical activity, heart rate, and sleep monitoring. \n","*    And it is preprocessed data.    "]},{"cell_type":"markdown","id":"26f86a43","metadata":{"papermill":{"duration":0.008126,"end_time":"2022-11-20T02:24:38.739924","exception":false,"start_time":"2022-11-20T02:24:38.731798","status":"completed"},"tags":[]},"source":["# 2.2 Limitation of the data : \n","\n","* Includes 30 users throughout a 30-day period starting in 2016. \n","* The source is out of date and the sample size is inadequate for accurate analysis. \n","* Since female users are Bellabeat's main market, there is no demographic information to ensure that the     data is representative of them."]},{"cell_type":"markdown","id":"9b446e13","metadata":{"papermill":{"duration":0.00811,"end_time":"2022-11-20T02:24:38.75626","exception":false,"start_time":"2022-11-20T02:24:38.74815","status":"completed"},"tags":[]},"source":["2.3 Credibility of the data:\n"," \n","*  We can't tell that this dataset is a sample population because only 30 users of the data collected.\n","*  And most of all it is a second party data that it is not from the bellaband organization.\n"]},{"cell_type":"markdown","id":"bfaa7068","metadata":{"papermill":{"duration":0.008157,"end_time":"2022-11-20T02:24:38.772436","exception":false,"start_time":"2022-11-20T02:24:38.764279","status":"completed"},"tags":[]},"source":["# 3. Process Phase "]},{"cell_type":"markdown","id":"5861a536","metadata":{"papermill":{"duration":0.00811,"end_time":"2022-11-20T02:24:38.788773","exception":false,"start_time":"2022-11-20T