e to women also but this dataset does not specify the women that we have used here so if we want some insights for ovulation in women, reproductive health we need some more dataset related to women for extra insights"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":8.890829,"end_time":"2022-11-20T02:24:44.296588","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-11-20T02:24:35.405759","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}